import React from "react";
import styled from "styled-components";
import Footer from "../Footer";

const Container = styled.div`
  background-color: #252525;
  width: 98vw;
  height: calc(100vh - 75px);
`;

const Login = () => {
  return (
    <div>
      <Container></Container>
      <Footer />
    </div>
  );
};

export default Login;
